    public static void addFakeUsers(){
        ArrayList<User> users = generateUsers();
        for (int i = 0; i < users.size(); i++) {
            String uId = DBupdater.getUsersRef().push().getKey();
            users.get(i).setUid(uId);
            DBupdater.getInstance().updateUser(users.get(i));
        }
    }

    //============================================

    public static void generateAppLists(){
        ArrayList<String> tips = TestDB.generateTips();
        ArrayList<String> rewards_info = TestDB.generateRewards_info();

        pushValues(tips,KEYS.TIPS_REF);
        pushValues(rewards_info,KEYS.REWARDS_INFO_REF);
    }

    private static void pushValues(List list, String ref){
        for (int i = 0; i < list.size(); i++)
            DBupdater.getDBref(ref).push().setValue(list.get(i));
    }

    public static void pushStoreItems(String ref){
        ArrayList<StoreItem> storeItems = generateStoreItems();
        for (int i = 0; i < storeItems.size(); i++)
            DBupdater.getDBref(ref).child(storeItems.get(i).getTitle()).setValue(storeItems.get(i));
    }

